Here's an example of the code that gets generated for the samples/monster.fbs. What follows is the entire file, broken up by comments: // automatically generated, do not modify #include "flatbuffers/flatbuffers.h" namespace MyGame {
namespace Sample { Nested namespace support. enum { Color_Red = 0, Color_Green = 1, Color_Blue = 2,
}; inline const char **EnumNamesColor() { static const char *names[] = { "Red", "Green", "Blue", nullptr }; return names;
} inline const char *EnumNameColor(int e) { return EnumNamesColor()[e]; } Enums and convenient reverse lookup. enum { Any_NONE = 0, Any_Monster = 1,
}; inline const char **EnumNamesAny() { static const char *names[] = { "NONE", "Monster", nullptr }; return names;
} inline const char *EnumNameAny(int e) { return EnumNamesAny()[e]; } Unions share a lot with enums. struct Vec3;
struct Monster; Predeclare all data types since circular references between types are allowed (circular references between object are not, though). FLATBUFFERS_MANUALLY_ALIGNED_STRUCT(4) Vec3 { private: float x_; float y_; float z_; public: Vec3(float x, float y, float z) : x_(flatbuffers::EndianScalar(x)), y_(flatbuffers::EndianScalar(y)), z_(flatbuffers::EndianScalar(z)) {} float x() const { return flatbuffers::EndianScalar(x_); } float y() const { return flatbuffers::EndianScalar(y_); } float z() const { return flatbuffers::EndianScalar(z_); }
};
FLATBUFFERS_STRUCT_END(Vec3, 12); These ugly macros do a couple of things: they turn off any padding the compiler might normally do, since we add padding manually (though none in this example), and they enforce alignment chosen by FlatBuffers. This ensures the layout of this struct will look the same regardless of compiler and platform. Note that the fields are private: this is because these store little endian scalars regardless of platform (since this is part of the serialized data). EndianScalar then converts back and forth, which is a no-op on all current mobile and desktop platforms, and a single machine instruction on the few remaining big endian platforms. struct Monster : private flatbuffers::Table { const Vec3 *pos() const { return GetStruct<const Vec3 *>(4); } int16_t mana() const { return GetField<int16_t>(6, 150); } int16_t hp() const { return GetField<int16_t>(8, 100); } const flatbuffers::String *name() const { return GetPointer<const flatbuffers::String *>(10); } const flatbuffers::Vector<uint8_t> *inventory() const { return GetPointer<const flatbuffers::Vector<uint8_t> *>(14); } int8_t color() const { return GetField<int8_t>(16, 2); }
}; Tables are a bit more complicated. A table accessor struct is used to point at the serialized data for a table, which always starts with an offset to its vtable. It derives from Table, which contains the GetField helper functions. GetField takes a vtable offset, and a default value. It will look in the vtable at that offset. If the offset is out of bounds (data from an older version) or the vtable entry is 0, the field is not present and the default is returned. Otherwise, it uses the entry as an offset into the table to locate the field. struct MonsterBuilder { flatbuffers::FlatBufferBuilder &fbb_; flatbuffers::uoffset_t start_; void add_pos(const Vec3 *pos) { fbb_.AddStruct(4, pos); } void add_mana(int16_t mana) { fbb_.AddElement<int16_t>(6, mana, 150); } void add_hp(int16_t hp) { fbb_.AddElement<int16_t>(8, hp, 100); } void add_name(flatbuffers::Offset<flatbuffers::String> name) { fbb_.AddOffset(10, name); } void add_inventory(flatbuffers::Offset<flatbuffers::Vector<uint8_t>> inventory) { fbb_.AddOffset(14, inventory); } void add_color(int8_t color) { fbb_.AddElement<int8_t>(16, color, 2); } MonsterBuilder(flatbuffers::FlatBufferBuilder &_fbb) : fbb_(_fbb) { start_ = fbb_.StartTable(); } flatbuffers::Offset<Monster> Finish() { return flatbuffers::Offset<Monster>(fbb_.EndTable(start_, 7)); }
}; MonsterBuilder is the base helper struct to construct a table using a FlatBufferBuilder. You can add the fields in any order, and the Finish call will ensure the correct vtable gets generated. inline flatbuffers::Offset<Monster> CreateMonster(flatbuffers::FlatBufferBuilder &_fbb, const Vec3 *pos, int16_t mana, int16_t hp, flatbuffers::Offset<flatbuffers::String> name, flatbuffers::Offset<flatbuffers::Vector<uint8_t>> inventory, int8_t color) { MonsterBuilder builder_(_fbb); builder_.add_inventory(inventory); builder_.add_name(name); builder_.add_pos(pos); builder_.add_hp(hp); builder_.add_mana(mana); builder_.add_color(color); return builder_.Finish();
} CreateMonster is a convenience function that calls all functions in MonsterBuilder above for you. Note that if you pass values which are defaults as arguments, it will not actually construct that field, so you can probably use this function instead of the builder class in almost all cases. inline const Monster *GetMonster(const void *buf) { return flatbuffers::GetRoot<Monster>(buf); } This function is only generated for the root table type, to be able to start traversing a FlatBuffer from a raw buffer pointer. }; // namespace MyGame
}; // namespace Sample

