Unions share a lot of properties with enums, but instead of new names for constants, you use names of tables. You can then declare a union field, which can hold a reference to any of those types, and additionally a field with the suffix _type is generated that holds the corresponding enum value, allowing you to know which type to cast to at runtime. It's possible to give an alias name to a type union. This way a type can even be used to mean different things depending on the name used: table PointPosition { x:uint; y:uint; }
table MarkerPosition {}
union Position { Start:MarkerPosition, Point:PointPosition, Finish:MarkerPosition
} Unions contain a special NONE marker to denote that no value is stored so that name cannot be used as an alias. Unions are a good way to be able to send multiple message types as a FlatBuffer. Note that because a union field is really two fields, it must always be part of a table, it cannot be the root of a FlatBuffer by itself. If you have a need to distinguish between different FlatBuffers in a more open-ended way, for example for use as files, see the file identification feature below. There is an experimental support only in C++ for a vector of unions (and types). In the example IDL file above, use [Any] to add a vector of Any to Monster table. There is also experimental support for other types besides tables in unions, in particular structs and strings. There's no direct support for scalars in unions, but they can be wrapped in a struct at no space cost.

