Include the header flexbuffers.h, which in turn depends on flatbuffers.h and util.h. To create a buffer: flexbuffers::Builder fbb;
fbb.Int(13);
fbb.Finish(); You create any value, followed by Finish. Unlike FlatBuffers which requires the root value to be a table, here any value can be the root, including a lonely int value. You can now access the std::vector<uint8_t> that contains the encoded value as fbb.GetBuffer(). Write it, send it, or store it in a parent FlatBuffer. In this case, the buffer is just 3 bytes in size. To read this value back, you could just say: auto root = flexbuffers::GetRoot(my_buffer);
int64_t i = root.AsInt64(); FlexBuffers stores ints only as big as needed, so it doesn't differentiate between different sizes of ints. You can ask for the 64 bit version, regardless of what you put in. In fact, since you demand to read the root as an int, if you supply a buffer that actually contains a float, or a string with numbers in it, it will convert it for you on the fly as well, or return 0 if it can't. If instead you actually want to know what is inside the buffer before you access it, you can call root.GetType() or root.IsInt() etc. Here's a slightly more complex value you could write instead of fbb.Int above: fbb.Map([&]() { fbb.Vector("vec", [&]() { fbb.Int(-100); fbb.String("Fred"); fbb.IndirectFloat(4.0f); }); fbb.UInt("foo", 100);
}); This stores the equivalent of the JSON value { vec: [ -100, "Fred", 4.0 ], foo: 100 }. The root is a dictionary that has just two key-value pairs, with keys vec and foo. Unlike FlatBuffers, it actually has to store these keys in the buffer (which it does only once if you store multiple such objects, by pooling key values), but also unlike FlatBuffers it has no restriction on the keys (fields) that you use. The map constructor uses a C++11 Lambda to group its children, but you can also use more conventional start/end calls if you prefer. The first value in the map is a vector. You'll notice that unlike FlatBuffers, you can use mixed types. There is also a TypedVector variant that only allows a single type, and uses a bit less memory. IndirectFloat is an interesting feature that allows you to store values by offset rather than inline. Though that doesn't make any visible change to the user, the consequence is that large values (especially doubles or 64 bit ints) that occur more than once can be shared (see ReuseValue). Another use case is inside of vectors, where the largest element makes up the size of all elements (e.g. a single double forces all elements to 64bit), so storing a lot of small integers together with a double is more efficient if the double is indirect. Accessing it: auto map = flexbuffers::GetRoot(my_buffer).AsMap();
map.size(); // 2
auto vec = map["vec"].AsVector();
vec.size(); // 3
vec[0].AsInt64(); // -100;
vec[1].AsString().c_str(); // "Fred";
vec[1].AsInt64(); // 0 (Number parsing failed).
vec[2].AsDouble(); // 4.0
vec[2].AsString().IsTheEmptyString(); // true (Wrong Type).
vec[2].AsString().c_str(); // "" (This still works though).
vec[2].ToString().c_str(); // "4" (Or have it converted).
map["foo"].AsUInt8(); // 100
map["unknown"].IsNull(); // true

