} Creating Analagously to how a union adds two fields to a table a vector of unions creates two different vectors: one for the union data and one for the data types. C++ supports vectors of unions, but it isn't currently documented. Typescript supports vectors of unions, but it isn't currently documented. PHP supports vectors of unions, but it isn't currently documented. Java supports vectors of unions, but it isn't currently documented. ~~~{.cs}
